import React from "react";

function Projects(props) {
  return (
    <div className="projectTile">
      <a href="https://www.google.com">
      <div>
        <h1>{props.title}</h1>
      </div>
      <div>
        <h4>{props.components}</h4>
      </div>
      <div>
        <p>{props.text}</p>
      </div>
      </a>
    </div>
  );
}

export default Projects;
